import React from 'react'
import { Link } from 'react-router-dom'

export const BirthdayItem = ({ birthday }) => {
  return (
    <Link to={`/birthday/${birthday.id}`}>
      <div className='birthdayContainer'>
        <h3 className='noteBody'>{birthday.description}</h3>
        <h3 className='noteDate'>{birthday.birthday}</h3>
      </div>
    </Link>
  )
}
